import React from 'react'
import styled from 'styled-components'
import ElectricBoltIcon from '@mui/icons-material/ElectricBolt';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Card = styled.div`
background:black;
display:flex;
flex-direction:column;
width:100%;
height:45rem;
align-items:center;
justify-content:center;
`;

const Tagline = styled.div`
font-size:30px;
width:30%;
`;

const CarDetail = styled.div`
width:70%;
`; 

const CarName = styled.div`
line-height:4rem;
font-size:20px;
`;

const CarType = styled.div`
font-size:16px;
line-height:3rem;
`;

const CarImage = styled.img`
height:370px;
width:700px;

`;

const CarFeature = styled.div`
display:flex;
justify-content:center; 
align-items:center;

line-height:7rem

`;

const MainFeatures = styled.div`
display:flex;


font-size:13px;

`;
const HorsePower = styled.div`
display:flex;
align-items:center;

`;

function CarCard() {
  return (
    <Card>
        <Tagline><h2>Choose The Best Car</h2></Tagline>
        <br />
        <CarDetail>

            <CarName><h3>Koenigsegg Agera R</h3></CarName>
            <CarImage src='images/agera.png' />
            <CarFeature>
                <MainFeatures>
                    <HorsePower>
                        <FontAwesomeIcon icon="fa-solid fa-chess-knight" />
                        <h2>1,160 hp @ 7,800 rpm</h2>
                    </HorsePower>
                    <HorsePower>
                        <ElectricBoltIcon />
                        <h2>1,160 hp @ 7,800 rpm</h2>
                    </HorsePower>
                    <HorsePower>
                        <ElectricBoltIcon />
                        <h2>1,160 hp @ 7,800 rpm</h2>
                    </HorsePower>
                </MainFeatures>
                
            </CarFeature>
        </CarDetail>
    </Card>
  )
}

export default CarCard
